import React, { Component } from "react";
import { navigate } from "@reach/router";
import SubNav from "./SubNav";
import "../css/GlobalNav.css";
import "../css/menu.css"

// const LinkStyle = {
//   color: "#4caf50",
//   textDecoration: "none",
//   textShadow: "1px 1px black"
// };

export default class Menu extends Component {
  componentDidMount() {}

  goDesigns = e => {
    navigate(`/designs`);
  };

  render() {
    return (
      <React.Fragment>
        <SubNav />

        <div className="menu-nav">

            <button onClick={this.goDesigns} className="design bttn">DESIGN</button>
            <li><button onClick={this.goIllustration} className="illustration bttn">ILLUSTRATION</button></li>
            <li><button onClick={this.goPaintings} className="paintings bttn">PAINTINGS</button></li>
            <li><button onClick={this.goPhotography} className="photography bttn">PHOTOGRAPHY</button></li>
        </div>
      </React.Fragment>
    );
  }
}
